  useEffect(() => { document.title = `Count:${count}`; }, [count]);



  return (
    <div className="App">
      <p>Count:{count}</p>
      <button onClick={() =>  setCount(count +1)}>Increament </button>
     {/* <ExpensiveComputationExample/> */}
